#include <stdio.h>
#include <string.h>

#include "mersenne.h"
#include "xmlutil.h"

/* Period parameters */  
#define N MERSENNE_ARRAY_SIZE   /* 624 */
#define M 397
#define MATRIX_A 0x9908b0dfUL   /* constant vector a */
#define UPPER_MASK 0x80000000UL /* most significant w-r bits */
#define LOWER_MASK 0x7fffffffUL /* least significant r bits */

#define MERSENNE_DEFAULT_SEED 5489UL

RandomNumberGenerator* newRNG() {
  RandomNumberGenerator* rng;
  rng = (RandomNumberGenerator*) SafeMalloc(sizeof(RandomNumberGenerator));
  rng->mti = MERSENNE_ARRAY_SIZE + 1;
  return rng;
}

void deleteRNG (RandomNumberGenerator* rng) {
  SafeFree (rng);
}

/* initializes mt[N] with a seed */
void rngSeed(RandomNumberGenerator* rng, unsigned long s)
{
    rng->mt[0]= s & 0xffffffffUL;
    for (rng->mti=1; rng->mti<N; rng->mti++) {
        rng->mt[rng->mti] = 
	    (1812433253UL * (rng->mt[rng->mti-1] ^ (rng->mt[rng->mti-1] >> 30)) + rng->mti); 
        /* See Knuth TAOCP Vol2. 3rd Ed. P.106 for multiplier. */
        /* In the previous versions, MSBs of the seed affect   */
        /* only MSBs of the array rng->mt[].                        */
        /* 2002/01/09 modified by Makoto Matsumoto             */
        rng->mt[rng->mti] &= 0xffffffffUL;
        /* for >32 bit machines */
    }
}

/* initialize by an array with array-length */
/* init_key is the array for initializing keys */
/* key_length is its length */
/* slight change for C++, 2004/2/26 */
void rngSeedArray (RandomNumberGenerator* rng, unsigned long init_key[], int key_length)
{
    int i, j, k;
    rngSeed(rng,19650218UL);
    i=1; j=0;
    k = (N>key_length ? N : key_length);
    for (; k; k--) {
        rng->mt[i] = (rng->mt[i] ^ ((rng->mt[i-1] ^ (rng->mt[i-1] >> 30)) * 1664525UL))
          + init_key[j] + j; /* non linear */
        rng->mt[i] &= 0xffffffffUL; /* for WORDSIZE > 32 machines */
        i++; j++;
        if (i>=N) { rng->mt[0] = rng->mt[N-1]; i=1; }
        if (j>=key_length) j=0;
    }
    for (k=N-1; k; k--) {
        rng->mt[i] = (rng->mt[i] ^ ((rng->mt[i-1] ^ (rng->mt[i-1] >> 30)) * 1566083941UL))
          - i; /* non linear */
        rng->mt[i] &= 0xffffffffUL; /* for WORDSIZE > 32 machines */
        i++;
        if (i>=N) { rng->mt[0] = rng->mt[N-1]; i=1; }
    }

    rng->mt[0] = 0x80000000UL; /* MSB is 1; assuring non-zero initial array */ 
}

char* getRngStateString (RandomNumberGenerator* rng) {
  char *s;
  int n;
  s = SafeMalloc ((MERSENNE_STATE_STRING_LENGTH + 1) * sizeof(char));
  for (n = 0; n < MERSENNE_ARRAY_SIZE; ++n)
    sprintf (s + 8*n, "%lx", rng->mt[n]);
  return s;
}

void rngSetStateString (RandomNumberGenerator* rng, char* stateString) {
  char tmp;
  int n, startpos, endpos;
  Assert (stateString != NULL && strlen(stateString) == MERSENNE_STATE_STRING_LENGTH, "Bad state string for random number generator");
  for (n = 0; n < MERSENNE_ARRAY_SIZE; ++n) {
    startpos = 8*n;
    endpos = startpos + 8;
    tmp = stateString[endpos];
    stateString[endpos] = '\0';
    rng->mt[n] = (unsigned long) hexToUnsignedLongLong (stateString + startpos);
    stateString[endpos] = tmp;
  }
}

/* generates a random number on [0,0xffffffff]-interval */
unsigned long rngRandomInt32 (RandomNumberGenerator* rng)
{
    unsigned long y;
    static unsigned long mag01[2]={0x0UL, MATRIX_A};
    /* mag01[x] = x * MATRIX_A  for x=0,1 */

    if (rng->mti >= N) { /* generate N words at one time */
        int kk;

        if (rng->mti == N+1)   /* if init_genrand() has not been called, */
	  rngSeed(rng,MERSENNE_DEFAULT_SEED); /* a default initial seed is used */

        for (kk=0;kk<N-M;kk++) {
            y = (rng->mt[kk]&UPPER_MASK)|(rng->mt[kk+1]&LOWER_MASK);
            rng->mt[kk] = rng->mt[kk+M] ^ (y >> 1) ^ mag01[y & 0x1UL];
        }
        for (;kk<N-1;kk++) {
            y = (rng->mt[kk]&UPPER_MASK)|(rng->mt[kk+1]&LOWER_MASK);
            rng->mt[kk] = rng->mt[kk+(M-N)] ^ (y >> 1) ^ mag01[y & 0x1UL];
        }
        y = (rng->mt[N-1]&UPPER_MASK)|(rng->mt[0]&LOWER_MASK);
        rng->mt[N-1] = rng->mt[M-1] ^ (y >> 1) ^ mag01[y & 0x1UL];

        rng->mti = 0;
    }
  
    y = rng->mt[rng->mti++];

    /* Tempering */
    y ^= (y >> 11);
    y ^= (y << 7) & 0x9d2c5680UL;
    y ^= (y << 15) & 0xefc60000UL;
    y ^= (y >> 18);

    return y;
}

/* generates a random number on [0,0x7fffffff]-interval */
long rngRandomInt31 (RandomNumberGenerator* rng)
{
    return (long)(rngRandomInt32(rng)>>1);
}

/* Real versions deleted, as FPU differences make them unreproducible - IH 2011/5/4 */

int64_Millionths rngRandomProb (RandomNumberGenerator* rng) {
  int64_Millionths p;
  p = (int64_Millionths)(rngRandomInt32(rng) & MillionthsMask);

#ifdef RNG_DEBUG
  fprintf(stderr,"rngRandomProb: %llx\n", p);
#endif /* RNG_DEBUG */

  return p;
}

