int64_Microticks rngRandomWait (RandomNumberGenerator* rng, int64_Microhurtz rate) {
  unsigned long long x, x2, ymin, ymax, y, rv;
  x = rngRandomInt32(rng) & 0xfff;
  x2 = rngRandomInt32(rng);
  ymax = logLookup[x];
  ymin = logLookup[x+1];
  y = ymin + ((ymax - ymin) * x2 >> 32);
  rv = y / rate;

#ifdef RNG_DEBUG
  fprintf(stderr,"rngRandomWait: %lld (rate=%lld)\n", rv, rate);
#endif /* RNG_DEBUG */

  return rv;
}
